import React from 'react';
import './RecipeCard.css';

const RecipeCard = ({ recipe, onRecipeClick }) => {

    return (
        <div className='Card'>
            <h3>{recipe.name}</h3>
            <p>Prep time: {recipe.prepTime} minutes</p>
            <Link to={`/recipe/${recipe.id}`}>
      <button>View Details</button>
    </Link>        </div>
    );
};

export default RecipeCard;
